                        </div>
                        <div class=\"form-group\">
                            <button class=\"btn btn-info mt-2 text-white\">Enviar</button>
                        </div>
                    {{ form_end(form) }}
                </div>
            </div>
        </div>
    </div>
</div>
{% endblock %}", "cliente/create.html.twig", "C:\\wamp64\\www\\crudSymfony\\templates\\cliente\\create.html.twig");
